// React library
import React from 'react';

// Context hooks
import { 
  useCurrentUser,
  useSetCurrentUser
} from '../contexts/CurrentUserContext';

// React-router-dom components for page navigation
import { NavLink, useHistory } from 'react-router-dom';

// Custom hooks
import useClickOutsideToggle from '../hooks/useClickOutsideToggle';

// Axios library for HTTP requests
import axios from 'axios';

// Utils
import { removeTokenTimestamp } from '../utils/utils';

// Reusable components
import Avatar from './Avatar';

// Bootstrap components
import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';

// Styles
import styles from '../styles/NavBar.module.css';


const NavBar = () => {
  // State variables
  const currentUser = useCurrentUser();
  const setCurrentUser = useSetCurrentUser();
  const history = useHistory();

  // Custom hook for toggling the navbar
  const { expanded, setExpanded, ref } = useClickOutsideToggle();

  const handleSignOut = async () => {
    try {
      await axios.post("dj-rest-auth/logout/");
      setCurrentUser(null);
      removeTokenTimestamp();
      history.push("/");
    } catch (err) {
      // console.log(err);
    }
  };
console.log('currentUser: ', currentUser);
  const addTaskIcon = (
    <NavLink
      className={styles.NavLink}
      activeClassName={styles.Active}
      to="/tasks/create"
    >
      <i className="far fa-plus-square"></i>
      Add task
    </NavLink>
  );
  const addCategoryIcon = (
    <NavLink
      className={styles.NavLink}
      activeClassName={styles.Active}
      to="/categories/create"
    >
      <i className="fas fa-folder-plus"></i>
      Add category
    </NavLink>
  );
  const loggedInIcons = (
    <>
      <NavLink
        exact
        className={styles.NavLink}
        activeClassName={styles.Active}
        to='/tasks/'
      >
        <i className='fs-6 fas fa-home'></i>
        Home
      </NavLink>
      <NavLink
        className={styles.NavLink}
        activeClassName={styles.Active}
        // to={`/tasks/?assigned_to=${currentUser?.username}`}
        to={`/tasks/?assigned_to=${currentUser?.pk}`}
      >
        <i className="fas fa-list-check"></i>
        My Tasks
      </NavLink>
      <NavLink className={styles.NavLink}
        to="/"
        onClick={handleSignOut}
      >
        <i className="fas fa-person-walking-arrow-right"></i>
        Sign out
      </NavLink>
      <NavLink
        className={styles.NavLink}
        to={`/profiles/${currentUser?.profile_id}`}
      >
        <Avatar
          src={currentUser?.profile_image}
          text="Profile"
          height={30}
        />
      </NavLink>
    </>
  );
  const loggedOutIcons = (
  <>
    <NavLink
      className={styles.NavLink}
      activeClassName={styles.Active}
      to='/signin'
    >
      <i className='fs-6 fas fa-sign-in-alt'></i>
      Sign in
    </NavLink>
    <NavLink
      className={styles.NavLink}
      activeClassName={styles.Active}
      to='/register'
    >
      <i className='fs-6 fas fa-user-plus'></i>
      Register
    </NavLink>
  </>
  );

  return (
    <Navbar expanded={expanded} className={styles.NavBar} expand="md" fixed="top">
      <Container>
        <NavLink to='/'>
          <Navbar.Brand className={styles.Brand}>
            <i className="fa-solid fa-calendar-check"></i>
            <span>
            <strong>TICK</strong> <em>OFF</em>
            </span>
          </Navbar.Brand>
        </NavLink>
        {currentUser && addTaskIcon}
        {currentUser && addCategoryIcon}
        <Navbar.Toggle
          ref={ref}
          onClick={() => setExpanded(!expanded)}
          aria-controls="basic-navbar-nav"
        />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto text-start">

            {currentUser ? loggedInIcons : loggedOutIcons}

          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}


export default NavBar;
